import React from 'react';

export default function MovieCard(props) {
  //onsole.log(props);
  return (
    <div className="card" key={props.item.id}>
      <div>
        <img
          className="card--image"
          src={`https://image.tmdb.org/t/p/w185_and_h278_bestv2/${props.item.poster_path}`}
          alt={`${props.item.title} Movie Image`}
        />
      </div>
      <div className="card--content">
        <h3 className="card--title">{props.item.title}</h3>
        <p>
          <small>RELEASE DATE: {props.item.release_date}</small>
        </p>
        <p>
          <small>RATING: {props.item.vote_average}</small>
        </p>
        <p className="card--desc">{props.item.overview}</p>
      </div>
    </div>
  );
}
